import React, { Component } from 'react';
import {Button, Dialog} from 'evergreen-ui';

class Units extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isShown: false,
    }
  }

  render() {
    return (
      <div>
        <Dialog
          isShown={this.state.isShown}
          title="Units"
          onCloseComplete={() => this.setState({isShown:false})}
          onConfirm={() => {console.log("updating material"); this.setState({isShown:false});}}>

          Dialog content
        </Dialog>
        <Button onClick={() => this.setState({isShown:true})}> Units</Button>
      </div>
    );
  }
}

export {Units};
